import React, { Component } from 'react';
import axios from 'axios';
import { Container, Row, Col } from 'reactstrap';

import { List1 } from './styles';

import MUIDataTable from "mui-datatables";


const columns = ["Estado", "Cidade", "Data", "Casos Confirmados","Mortes"];





const Data = props => [
   ];
const options = {
    filterType: 'checkbox',
  };

export default class FeedbackList extends Component {
  constructor(props) {
    super();

    this.state = {listas: []};
  }

  componentDidMount() {
    axios.get('http://localhost:5000/lista_diaria/')
      .then(response => {
        this.setState({ listas: response.data })
      })
      .catch((error) => {
        console.log(error);
      })
  }

  
  listaCovid() {
    return this.state.listas.map(currentmapalistdiario => {
      return <Data lista={currentmapalistdiario} key={currentmapalistdiario._id}/>;
    })
  }

  render() {
    return (
      <div>
        <List1>
        <h3>Casos Diarios</h3>
          </List1>
      <Container className="themed-container" fluid={true}>
        <Row>
        <Col>
        <table className="table">
          {/* <thead className="thead-light">
            <tr>
              <th>Estado</th>
              <th>Cidade</th>
              <th>Data</th>
              <th>Casos Confirmados</th>
              <th>Mortes</th>
            </tr>
          </thead> */}
          
            {/* { this.listaCovid() } */}
            <MUIDataTable 
 
             data = {Data} 
           columns={columns} 
            options={options} />
          
        </table>
        </Col>
        </Row>
      </Container>
      </div>
    )
  }
}
